import React from "react";
import Card from "./Card";

const CardList = ({ memes }) => {
  return (
    <div>
      {memes.map((id, i) => {
        return (
          <Card
            key={i}
            id={memes[i].id}
            img={memes[i].img}
            name={memes[i].name}
            email={memes[i].email}
          />
        );
      })}
    </div>
  );
};
export default CardList;
